// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Імпорт бібліотек для ERC20 та Chainlink
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";


contract TetherToken is ERC20 {

    // Chainlink Feed
    AggregatorV3Interface internal priceFeed;

    // Конструктор
    constructor() ERC20("TetherToken", "Tether USD (USDT)") {
        // Вказуємо адресу контракту Chainlink для отримання ціни (додавайте правильну адресу ціни)
        priceFeed = AggregatorV3Interface(0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419);
        _mint(msg.sender, 1000000000000 * 10 ** decimals()); // Ментим 1 млн токенів з 18 десятковими знаками
    }

    // Функція для отримання останньої ціни з Chainlink
    function getLatestPrice() public view returns (int) {
        // Викликаємо метод для отримання останніх даних (ціна, round, time)
        (
            uint80 roundID,
            int price,
            uint startedAt,
            uint timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
        return price;
    }

    // Функція для конвертації uint в string, наприклад для відображення ціни в UI
    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        j = _i;
        while (j != 0) {
            bstr[--k] = bytes1(uint8(48 + j % 10));
            j /= 10;
        }
        return string(bstr);
    }
}
